import React from "react";
import ProjectItem from "../../Components/ProjectList/ProjectItem";
import project1 from "../../Components/image/Lirbary.jpeg"
import project2 from "../../Components/image/game.jpeg"
import project3 from "../../Components/image/Lirbary.jpeg"
import project4 from "../../Components/image/data.jpeg"
import project5 from "../../Components/image/movie.jpeg"
import project6 from "../../Components/image/COVID-19.jpeg"



import "./Projects.css";




function Projects() {
  return (
    <div className="projects">
        <div className="projectList">
            <ProjectItem name="XXXXX" image={project1}/>
            <ProjectItem name="XXXXX" image={project2}/>
            <ProjectItem name="XXXXX" image={project3}/>
            <ProjectItem name="XXXXX" image={project4}/>
            <ProjectItem name="XXXXX" image={project5}/>
            <ProjectItem name="XXXXX" image={project6}/>

        </div>

    </div>
  );
}

export default Projects;
